// src/App.js

import React, {Component} from 'react';

class App extends Component {
  render () {
    return (
        <div className="App">
          <header className="App-header">
            <p>
              Quem Aqui joga League of Legends?.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
    );
  }
}

export default App;
